          to="/login"
          activeClassName={styles.active}
          className={styles.link}
        >
          Logout
        </NavLink>
        <br />
        <NavLink
          to={`/users/${username}/todos`}
          activeClassName={styles.active}
          className={styles.link}
        >
          Todos
        </NavLink>
        <br />
        <NavLink
          to={`/users/${username}/posts`}
          activeClassName={styles.active}
          className={styles.link}
        >
          Posts
        </NavLink>
        <br />
        <NavLink
          to="/albums"
          activeClassName={styles.active}
          className={styles.link}
        >
          Albums
        </NavLink>
        <br />
      </nav>
      <Outlet />
    </>

